import React from 'react';
import styles from '../styles/home_styles.css';
import Center from 'react-center';

export default props => {

    return (
        <div className="HomePage">

                <h2>
                    <span>JIAYI ZHANG</span>

                    <hr
                        style={{
                            color: 'black',
                            backgroundColor: 'black',
                            height: 2,
                            width: 700,
                            float: 'center'
                        }}
                    />

                </h2>

                <h3>
                    <span>Software Engineer | Professional in Volleyball</span>
                </h3>



                <a style="background-color:black;color:white;text-decoration:none;padding:4px 6px;font-family:-apple-system, BlinkMacSystemFont, &quot;San Francisco&quot;, &quot;Helvetica Neue&quot;, Helvetica, Ubuntu, Roboto, Noto, &quot;Segoe UI&quot;, Arial, sans-serif;font-size:12px;font-weight:bold;line-height:1.2;display:inline-block;border-radius:3px" href="https://unsplash.com/@saltnstreets?utm_medium=referral&amp;utm_campaign=photographer-credit&amp;utm_content=creditBadge" target="_blank" rel="noopener noreferrer" title="Download free do whatever you want high-resolution photos from Alesia Kazantceva"><span style="display:inline-block;padding:2px 3px"><svg xmlns="http://www.w3.org/2000/svg" style="height:12px;width:auto;position:relative;vertical-align:middle;top:-2px;fill:white" viewBox="0 0 32 32"><title>unsplash-logo</title><path d="M10 9V0h12v9H10zm12 5h10v18H0V14h10v9h12v-9z"></path></svg></span><span style="display:inline-block;padding:2px 3px">Alesia Kazantceva</span></a>



        </div>
    )
}
